import { Routes, Route, useLocation } from 'react-router-dom';
import { AnimatePresence } from 'framer-motion';
import Home from './pages/Home';
import Jobs from './pages/Jobs';
import JobDetail from './pages/JobDetail';
import CompanyProfile from './pages/CompanyProfile';
import Companies from './pages/Companies';
import CompaniesSearch from './pages/CompaniesSearch';
import Resume from './pages/Resume';
import Blog from './pages/Blog';
import Contact from './pages/Contact';
import Profile from './pages/Profile';
import Login from './pages/Auth/Login';
import Register from './pages/Auth/Register';
import Dashboard from './pages/User/Dashboard';
import SavedJobs from './pages/User/SavedJobs';
import Applications from './pages/User/Applications';
import Messages from './pages/User/Messages';
import Notifications from './pages/User/Notifications';
import Settings from './pages/User/Settings';
import CVBuilder from './pages/Resume/CVBuilder';
import PageTransition from './components/layout/PageTransition';
import ScrollToTop from './components/layout/ScrollToTop';

function App() {
  const location = useLocation();
  const isHomePage = location.pathname === '/';
  const isFromAuth = location.state?.from === '/login' || location.state?.from === '/register';

  return (
    <>
      <ScrollToTop />
      <Routes location={location} key={location.pathname}>
        <Route path="/" element={
          isFromAuth ? (
            <AnimatePresence mode="wait">
              <PageTransition>
                <Home />
              </PageTransition>
            </AnimatePresence>
          ) : (
            <Home />
          )
        } />
        <Route path="/jobs" element={<Jobs />} />
        <Route path="/jobs/:id" element={<JobDetail />} />
        <Route path="/companies/:id" element={<CompanyProfile />} />
        <Route path="/companies" element={<Companies />} />
        <Route path="/companies/search" element={<CompaniesSearch />} />
        <Route path="/resume" element={<Resume />} />
        <Route path="/resume/builder" element={<CVBuilder />} />
        <Route path="/blog" element={<Blog />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/profile" element={<Profile />} />
        <Route path="/login" element={<Login />} />
        <Route path="/register" element={<Register />} />
        {/* User Routes */}
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/saved-jobs" element={<SavedJobs />} />
        <Route path="/applications" element={<Applications />} />
        <Route path="/messages" element={<Messages />} />
        <Route path="/notifications" element={<Notifications />} />
        <Route path="/settings" element={<Settings />} />
      </Routes>
    </>
  );
}

export default App;
